let min = 9999999;

a.split(", ").forEach((val) => {
  let splits = val.split(" ")
  splits = splits.map((percent) => percent.slice(0, -1))
  let int1 = parseFloat(splits[0])
  let int2 = parseFloat(splits[1])
  if (int1 > max) max = int1
  if (int1 < min) min = int1
  if (int2 > max) max = int2
  if (int2 < min) min = int2
})

